// Transform text between Simplfied Chinese and Traditional Chinese
// to: S - to Simplfied Chinese, T - to Traditional Chinese
// text：text to transform
function CHINESE_SIMPLFIED_TRADITIONAL_TRANSFORM(to, text) {
    let transformed = '';

    if (to == 'T') {
        for (let i = 0; i < text.length; i++) {
            let textChar = text.charAt(i);
            let charPosition = CHINESE_CHARACTERS_SIMPLFIED.indexOf(textChar);
            transformed += charPosition < 0 ? textChar : CHINESE_CHARACTERS_TRADITIONAL.charAt(charPosition);
        }
    } else if (to == 'S') {
        for (let i = 0; i < text.length; i++) {
            let textChar = text.charAt(i);
            let charPosition = CHINESE_CHARACTERS_TRADITIONAL.indexOf(textChar);
            transformed += charPosition < 0 ? textChar : CHINESE_CHARACTERS_SIMPLFIED.charAt(charPosition);
        }
    } else {
        return text;
    }

    return transformed;
}


